class MinStore {
    constructor(myStyle)
    {
        this.dev=false;
		this.renderBounds=false;
		this.con = config[myStyle.toLowerCase()];  
		this.canvas = new fabric.Canvas(config.global.canvasId,{backgroundColor:config.global.screen,width:this.con.cw,height:this.con.ch,objectCaching:false,hoverCursor:"pointer"});
		this.user = inputs();
	    this.regex = (a)=> {return a.replace(/[\(\)\[\]:;#@\^\|\?\",<>\!\\_=\+\*~`\.\{\}']/g,"");};
	    this.allfix = "";
        this.item={chainLeft:"",chainRight:"",bounds:"",pendant:""};
        
        return this.render.bind(this)();
    }
	
	msg(a){console.log(a);}
	
	debug()
	{
		if(!this.dev) return;
		let report=
		{
			init:"Hello from scriptName"
			,userTxt:$(this.user.txt1).val()
			,alloy:$(this.user.alloy).prop("selectedIndex")
			,motif:$(this.user.motif).prop("selectedIndex")
			,accent:$(this.user.accent).prop("selectedIndex")
			,bounds:this.item.bounds
			,allfix:this.allfix
			,config:this.con
		}
		this.msg(JSON.stringify(report));
	}

	getUserInput()
	{
		this.msg(JSON.stringify($(this.user.accent)));
		this.allfix = "";
		let a = $(this.user.txt1).val();
		if(a.substring(0,1).match(/^[\&|\-]/g) || a === "" || a === "Enteryournamehere" || a === "Enter your name here") return;
		a = this.regex(a.split(" ").join(""));
		let b = ($(this.user.accent).prop("selectedIndex") === 0) ? this.con.suffixFn($(this.user.motif).prop("selectedIndex")) : this.con.suffixFn($(this.user.motif).prop("selectedIndex") + 4);
		this.allfix = (a.length > 0 && typeof $(this.user.accent).prop("selectedIndex") !== "undefined") ? this.con.prefixFn(a).concat(this.con.infixFn(a)).concat(b) : ""; 
	}

	setBounds()
	{	
		this.item.pendant =  new fabric.Text(this.allfix,{fontFamily:this.con.fontName,fontSize:this.con.fontSize,fill:"#b4b4b4",objectCaching:false});		
		this.canvas.add(this.item.pendant);
		this.item.pendant.center();
		this.item.bounds = this.item.pendant.getBoundingRect();
		if(!this.renderBounds){this.canvas.remove(this.item.pendant)};
	}
	
	drawRegion(bnd)
	{
		let aBox, bBox, cBox;
		aBox = new fabric.Rect({
			left:bnd.left - this.con.chainWidth
			,top:bnd.top - this.con.chainWidth
			,width:this.con.chainWidth
			,height:this.con.chainWidth
			,selectable:false
			,fill:""
			,stroke:"#f00"
			,strokeWidth:0.25
		});

		bBox = new fabric.Rect(this.item.bounds);
			bBox.stroke="#0f0";
			bBox.fill="";
			bBox.strokeWidth=0.25;

		cBox = new fabric.Rect({
			left:bnd.width + bnd.left
			,top:bnd.top - this.con.chainWidth
			,width:this.con.chainWidth
			,height:this.con.chainWidth
			,selectable:false
			,fill:""
			,stroke:"#00f"
			,strokeWidth:0.25
		});

		if(this.renderBounds) this.canvas.add(aBox).add(bBox).add(cBox);
	}

	gemMap()
	{
		let tg = $(this.user.motif).prop("selectedIndex");
		let plain = this.con.accentMap(this.item.bounds,tg);
		let accent = this.con.accentMap(this.item.bounds,tg+4);
		return ($(this.user.accent).prop("selectedIndex") === 0) ? {x:plain.x,y:plain.y} : {x:accent.x,y:accent.y};
		
    }
    
	draw()
	{
		this.canvas.clear();
		this.canvas.set({backgroundColor:config.global.screen});
		this.getUserInput();
		this.setBounds();
		this.drawRegion(this.item.bounds);

		this.item.pendant =  new fabric.Text(this.allfix,
			{
				fontFamily:this.con.fontName
				,fontSize:this.con.fontSize
				,fill:res.alloy($(this.user.alloy).prop("selectedIndex"))
				,left:this.item.bounds.left
				,top:this.item.bounds.top
				,selectable:false
				,shadow: `${res.shadow($(this.user.alloy).prop("selectedIndex"))} -1 -1 0`
				
			});		
		this.canvas.add(this.item.pendant);

		fabric.Image.fromURL(res.chain($(this.user.alloy).prop("selectedIndex")),(im)=>
		{
			im.scaleToWidth(this.con.chainWidth);
			im.set({left:this.item.bounds.left-this.con.chainWidth-3,top:this.con.prefixMap($(this.user.txt1).val()),objectCaching:false,selectable:false});
			if(this.allfix !== "") this.canvas.add(im);
		});

		fabric.Image.fromURL(res.chain($(this.user.alloy).prop("selectedIndex")),(im)=>
		{
			im.scaleToWidth(this.con.chainWidth);
			im.set({left:this.item.bounds.left+this.item.bounds.width+3,top:this.con.suffixMap($(this.user.accent).prop("selectedIndex"),$(this.user.motif).prop("selectedIndex")),flipX:true,objectCaching:false,selectable:false});
			if(this.allfix !== "") this.canvas.add(im);
		});
		
		fabric.Image.fromURL(res.accent($(this.user.accent).prop("selectedIndex")),(im)=>
		{
			im.scaleToWidth(this.con.gemSize);
			im.set({left:this.gemMap().x,top:this.gemMap().y,originX:"center",originY:"center",objectCaching:false,noScaleCache:false,selectable:false
			,shadow:"rgba(0,0,0,1) 0 0 2"});
			if(this.allfix !== "") 
			{
				this.canvas.add(im);
				im.animate("angle",360,
				{from:0,duration:7200,easing:fabric.util.ease.easeIn,onChange:this.canvas.renderAll.bind(this.canvas)});
			}
		});

		this.dropShadow = new fabric.Circle(
			{
				shadow:"rgba(0,0,0,1) 1 1 10",opacity:0.2,radius:(this.item.bounds.width * 0.5)
				,left:this.con.cw *0.5
				,top:this.con.ch*0.9
				,fill:"#efefef"
				,originX:"center"
				,originY:"center"
				,scaleY:0.01
				,objectCaching:false
				,selectable:false
			});
		
			this.canvas.add(this.dropShadow);
	}
    
    render()
    {
        $(document).on("keyup change", [this.user.txt1,this.user.alloy], (e)=>
		{	
			this.user = inputs();
			this.draw();
			this.debug();
        });
    }

  } //end class

    const res={
        accent:(a)=> 
        {
            return Object.values(
            {
            "blank":""
            ,"gen":"data:image/png;base64,"
            ,"jan":"data:image/png;base64,"
            ,"feb":"data:image/png;base64,"
            ,"mar":"data:image/png;base64,"
            ,"apr":"data:image/png;base64,"
            ,"may":"data:image/png;base64,"
            ,"jun":"data:image/png;base64,"
            ,"jul":"data:image/png;base64,"
            ,"aug":"data:image/png;base64,"
            ,"sep":"data:image/png;base64,"
            ,"oct":"data:image/png;base64,"
            ,"nov":"data:image/png;base64,"
            ,"dec":"data:image/png;base64,"
            })[a];
        }
        ,chain:(a)=>
        {
            a = (a > 0) ? a : 1; 
            return Object.values(
            {
                "blank":""
                ,"silver":"data:image/png;base64,"
                ,"yellow":"data:image/png;base64,"
                ,"rose":"data:image/png;base64,"
                ,"white":"data:image/png;base64,"
            })[a];
        }
        ,alloy:(a)=> {return Object.values({"None":"#BABABA","Silver":"#BABABA", "9k Yellow Gold":"#E0B97F", "9k Rose Gold":"#DDB8A9", "9k White Gold":"#C0C0C0"})[a]}
        ,shadow:(a)=> {return Object.values({"None":"#808080","Silver":"#808080", "9k Yellow Gold":"#AB8854", "9k Rose Gold":"#BA9282", "9k White Gold":"#808080"})[a]}
    }

    const config={
        global:{canvasId:"canvas",screen:"rgba(231,245,249,0.8)"}
        ,bname:
        {
            fontName:"bname"
            ,fontSize:35
            ,gemSize:14
            ,cw:420
            ,ch:250
            ,chainWidth:240
            ,prefixMap:(a)=>{return (a.length > 0 && a.substr(0,1).match(/[a-z]/g)) ? -127 : -150;}
            ,suffixMap:(accent,motif)=>
            {
                let n = {0:-132, 1:-123, 2:-132, 3:-122,4:-124,5:-123,6:-132,7:-122};
                return (accent === 0) ? Object.values(n)[motif] : Object.values(n)[motif+4];
            }
            ,accentMap:(bounds,i)=>{ let a = bounds.left+bounds.width;
            return {
                x:Object.values({0:0, 1:0, 2:0, 3:0, 4:(a-10),5:(a-22),6:(a-12.5),7:(a-25)})[i]
                ,y:Object.values({0:0, 1:0, 2:0, 3:0, 4:127,5:125,6:122,7:120})[i]}
            }
            ,prefixFn:(d)=> {return (d.length >= 1) ? String.fromCharCode(d.substring(0,1).charCodeAt(0) + 60000) : "";}
            ,infixFn:(a)=> {return (a.length > 1) ? a.substring(1,a.length) : "";}
            ,suffixFn:(a)=> {return String.fromCharCode(Object.values({0:61, 1:60091, 2:60040, 3:60123, 4:60062,5:60093,6:60041,7:60125})[a]);}
        }
        ,cname:
        {
            fontName:"cname"
            ,fontSize:35
            ,gemSize:14
            ,cw:420
            ,ch:250
            ,chainWidth:240
            ,prefixMap:(a)=>{return (a.length > 0 && a.substr(0,1).match(/[a-z]/g)) ? -126 : -142;}
            ,suffixMap:(accent,motif)=>
            {
                let n = {0:-127,1:-121,2:-127,3:-120,4:-121,5:-121,6:-127,7:-120};
                return (accent === 0) ? Object.values(n)[motif] : Object.values(n)[motif+4];
            }
            ,accentMap:(bounds,i)=>{ let a = bounds.left+bounds.width;
            return {
                x:Object.values({0:0, 1:0, 2:0, 3:0, 4:(a-8),5:(a-15),6:(a-10),7:(a-18)})[i]
                ,y:Object.values({0:0, 1:0, 2:0, 3:0, 4:129,5:126,6:124,7:122})[i]}
            }
            ,prefixFn:(d)=> {return (d.length >= 1) ? String.fromCharCode(d.substring(0,1).charCodeAt(0) + 60000) : "";}
            ,infixFn:(a)=> {return (a.length > 1) ? a.substring(1,a.length) : "";}
            ,suffixFn:(a)=> {return String.fromCharCode(Object.values({0:61, 1:60091, 2:60040, 3:60123, 4:60062,5:60093,6:60041,7:60125})[a]);}
        }
        ,mname:
        {
            fontName:"mname"
            ,fontSize:35
            ,gemSize:14
            ,cw:420
            ,ch:250
            ,chainWidth:240
            ,prefixMap:(a)=>{return (a.length > 0 && a.substr(0,1).match(/[a-z]/g)) ? -119 : -118;}
            ,suffixMap:(accent,motif)=>
            {
                let n = {0:-119, 1:-119, 2:-119, 3:-119, 4:-119,5:-119,6:-119,7:-119};
                return (accent === 0) ? Object.values(n)[motif] : Object.values(n)[motif+4];
            }
            ,accentMap:(bounds,i)=>{ let a = bounds.left+bounds.width;
            return {
                x:Object.values({0:0, 1:0, 2:0, 3:0, 4:(a-6),5:(a-13),6:(a-9),7:(a-15)})[i]
                ,y:Object.values({0:0, 1:0, 2:0, 3:0, 4:131,5:131,6:130,7:128})[i]}
            }
            ,prefixFn:(d)=> {return (d.length >= 1) ? String.fromCharCode(d.substring(0,1).charCodeAt(0) + 60000) : "";}
            ,infixFn:(a)=> {return (a.length > 1) ? a.substring(1,a.length) : "";}
            ,suffixFn:(a)=> {return String.fromCharCode(Object.values({0:61, 1:60091, 2:60040, 3:60123, 4:60062,5:60093,6:60041,7:60125})[a]);}
        }
    }
    
    const inputs=()=>
    {
        let user = {};
        user.txt1 = $("input[title='Enter your name here']");
            
        let tgt = $('select').toArray();
        $.each(tgt, (index)=> 
        {
            if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Silver")
            {
                user.alloy = $(tgt)[index];
            }
            if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Heart")
            {
                user.motif = $(tgt)[index];
            }
            if($(tgt).eq(index).find("option").length > 2 && $(tgt)[index].options[1].text === "Genuine Diamond")
            {
                user.accent = $(tgt)[index];
            }
        }); 
        return user;
    }
